import React from "react";
import axios from "axios";

export default async function SearchTaskFunc(
  limitVal = 10,
  pageVal = 1,
  searchVal = ""
) {
  const linkApi =
    searchVal === ""
      ? `api/tasks?limit=${limitVal}&page=${pageVal}`
      : `api/tasks?limit=${limitVal}&page=${pageVal}&search=${searchVal}`;

  console.log(linkApi);

  axios
    .get(linkApi)
    .then((result) => {
      console.log(result.data);
      return result.data;
    })
    .catch((error) => {
      const errorMsg = error.response.data.message;
      console.log(errorMsg);
    });

  return errorMsg;
}
